var sharedStringsFront = '<?xml version="1.0" encoding="UTF-8" standalone="yes"?><sst xmlns="http://schemas.openxmlformats.org/spreadsheetml/2006/main" count="$count" uniqueCount="$uniqueCount">';
var sharedStringsBack = '</sst>';
var shareStrings, convertedShareStrings;

function generateMultiSheets(configs, xlsx) {
    var i = 1;
    configs.forEach(function (config) {
        config.name = config.name ? config.name : ('sheet' + i);
        i++;
        var sheet = new Sheet(config, xlsx, shareStrings, convertedShareStrings);
        sheet.generate();
        convertedShareStrings = sheet.convertedShareStrings;
    });
}

function generateContentType(configs, xlsx) {
    var workbook = contentTypeFront;
    configs.forEach(function (config) {
        workbook += '<Override PartName="/' + config.fileName + '" ContentType="application/vnd.openxmlformats-officedocument.spreadsheetml.worksheet+xml" />';
    });
    workbook += contentTypeBack;
    xlsx.file('[Content_Types].xml', workbook);
}

function generateRel(configs, xlsx) {
    var workbook = relFront;
    var i = 1;
    configs.forEach(function (config) {
        workbook += '<Relationship Id="rId' + i + '" Type="http://schemas.openxmlformats.org/officeDocument/2006/relationships/worksheet" Target="worksheets/' + config.name + '.xml"/>';
        i++;
    });
    workbook += relBack;
    xlsx.file('xl/_rels/workbook.xml.rels', workbook);
    xlsx.file('_rels/.rels', '<?xml version="1.0" encoding="UTF-8" standalone="yes"?>'
        + '<Relationships xmlns="http://schemas.openxmlformats.org/package/2006/relationships">'
        + '<Relationship Id="rId1" Type="http://schemas.openxmlformats.org/officeDocument/2006/relationships/officeDocument" Target="xl/workbook.xml"/>'
        + '<Relationship Id="rId2" Type="http://schemas.openxmlformats.org/package/2006/relationships/metadata/core-properties" Target="docProps/core.xml"/>'
        + '<Relationship Id="rId3" Type="http://schemas.openxmlformats.org/officeDocument/2006/relationships/extended-properties" Target="docProps/app.xml"/>'
        + '</Relationships>'
    );
}

function generateWorkbook(configs, xlsx) {
    var workbook = sheetsFront;
    var i = 1;
    configs.forEach(function (config) {
        workbook += '<sheet name="' + config.name + '" sheetId="' + i + '" r:id="rId' + i + '"/>';
        i++;
    });
    workbook += sheetsBack;
    xlsx.file('xl/workbook.xml', workbook);
}

function generateSharedStringsFile(xlsx) {
    var lengthShareStrings = Object.keys(shareStrings).length;
    if (lengthShareStrings > 0) {
        var sharedStringsFrontTmp = sharedStringsFront.replace(/\$count/g, lengthShareStrings).replace(/\$uniqueCount/g, lengthShareStrings);
        xlsx.file("xl/sharedStrings.xml", (sharedStringsFrontTmp + convertedShareStrings + sharedStringsBack));
    }
    convertedShareStrings = "";
}

function replaceAppProperties(xlsx) {
    xlsx.remove('docProps/app.xml');
    var app = '<?xml version="1.0" encoding="UTF-8" standalone="yes"?>' +
        '<Properties xmlns="http://schemas.openxmlformats.org/officeDocument/2006/extended-properties" xmlns:vt="http://schemas.openxmlformats.org/officeDocument/2006/docPropsVTypes"><Application>Microsoft Excel</Application><DocSecurity>0</DocSecurity><ScaleCrop>false</ScaleCrop><HeadingPairs><vt:vector size="2" baseType="variant"><vt:variant><vt:lpstr>Feuilles de calcul</vt:lpstr></vt:variant><vt:variant><vt:i4>1</vt:i4></vt:variant></vt:vector></HeadingPairs><TitlesOfParts><vt:vector size="1" baseType="lpstr"><vt:lpstr>sheet1</vt:lpstr></vt:vector></TitlesOfParts><LinksUpToDate>false</LinksUpToDate><SharedDoc>false</SharedDoc><HyperlinksChanged>false</HyperlinksChanged><AppVersion>14.0300</AppVersion>' +
        '</Properties>';
    xlsx.file('docProps/app.xml', app);
}

function generateCodeProperties(xlsx) {
    var dateUpdated = (new Date()).toISOString();
    xlsx.remove('package');
    var core = '<?xml version="1.0" encoding="UTF-8" standalone="yes"?>' +
        '<cp:coreProperties xmlns:cp="http://schemas.openxmlformats.org/package/2006/metadata/core-properties" xmlns:dc="http://purl.org/dc/elements/1.1/" xmlns:dcterms="http://purl.org/dc/terms/" xmlns:dcmitype="http://purl.org/dc/dcmitype/" xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance">' +
        '<dcterms:created xsi:type="dcterms:W3CDTF">' + dateUpdated + '</dcterms:created>' +
        '<dcterms:modified xsi:type="dcterms:W3CDTF">' + dateUpdated + '</dcterms:modified>' +
        '</cp:coreProperties>';
    xlsx.file('docProps/core.xml', core);
}

function replaceTheme(xlsx) {
    xlsx.remove('xl/theme/theme.xml');
    xlsx.file('xl/theme/theme1.xml', themeFront);
}

exports.executeAsync = function (config, callBack) {
    return process.nextTick(function () {
        var r = exports.execute(config);
        callBack(r);
    });
};

exports.execute = function (config) {
    var xlsx = new JSZip(templateXLSX, {
        base64: true,
        checkCRC32: false
    });
    shareStrings = {};
    convertedShareStrings = "";

    var configs = [];
    if (config instanceof Array) {
        configs = config;
    } else {
        configs.push(config);
    }
    generateMultiSheets(configs, xlsx);
    generateWorkbook(configs, xlsx);
    generateRel(configs, xlsx);
    generateContentType(configs, xlsx);
    generateSharedStringsFile(xlsx);

    // fix for new ms excel
    replaceAppProperties(xlsx);
    generateCodeProperties(xlsx);
    replaceTheme(xlsx);

    var results = xlsx.generate({
        base64: false,
        compression: "DEFLATE"
    });
    delete shareStrings;
    delete xlsx;
    return results;
};

